def ceps(init=[], fin=[], filename='cepsValidos.txt'):
	"""
	ceps([12201,3], [12248,999])
	"""
	ini = int(str(init[0]) + str(init[1]).zfill(3))
	fim = int(str(fin[0]) + str(fin[1]).zfill(3))

	f = open(filename, 'a')
	i = 0
	while ini <= fim:
		if i > 400:
			break
		url = """http://cep.republicavirtual.com.br/web_cep.php?formato=query_string&cep={0}""".format(ini)
		req = urllib.request.urlopen(url)
		data = req.read()

		try:
			if re.match(b'[0-9]',data):
				f.write(data.decode("utf-8"))
				f.write('\n')
				f.flush()
			else:
				f.write(str(ini))

		except Exception as e:
			f.write(str(ini))
			f.write('\t-->Problema')

		f.write('\n')
		f.flush()
		i+=1
		ini+=1
	f.closed


def readCSV(filename):
	import csv
	with open(filename, newline='') as csvfile:
		items = []
		cabecalho = {}
		spamreader = csv.reader(csvfile, delimiter=',') #quotechar='|'
		isFirstLine = True

		for row in spamreader:
			# print(row)
			if isFirstLine:
				cabecalho = [i.replace('"', '').strip() for i in row]
				isFirstLine = False
			else:
				# [ '#', 'region', 'neighborhoods', 'lat', 'lng', 'price_by_meter', 'residents', 'occupied_private_housing', 'residents_per_household', 
				# 'delegacy', 'hospital', 'ubs', 'upa', 'school', 'market', 'shopping', 'university', 'bank']
				d = {}
				for i in range(len(row)):
					d[cabecalho[i]] = row[i].replace('"', '').strip()
				items.append(d)
		
		return items

list_postal_codes = []
def geocode(cep, address, **geo_args):
	GEOCODE_BASE_URL = 'http://maps.googleapis.com/maps/api/geocode/json'
	geo_args.update({
		'address': address.replace(' ', '+'),
		'sensor': 'false'
	})
	url = GEOCODE_BASE_URL + '?' + urllib.parse.urlencode(geo_args)
	req = urllib.request.urlopen(url)
	data = req.read()
	result = json.loads(data.decode("utf-8"))
	try:
		d = {}
		for i in result['results'][0]['address_components']:
			if 'route' in i['types']:
				d['address'] = i['long_name']

			elif 'neighborhood' in i['types']:
				d['neighborhood'] = i['long_name']

			elif 'locality' in i['types']:
				d['locality'] = i['long_name']

			elif 'administrative_area_level_1' in i['types']:
				d['abbreviation_state'] = i['short_name']
				d['state'] = i['short_name']

			elif 'country' in i['types']:
				d['abbreviation_country'] = i['short_name']
				d['country'] = i['long_name']

			d['type'] = 'postal_code'
			d['postal_code'] = cep
		d['lat'] = result['results'][0]['geometry']['location']['lat']
		d['lng'] = result['results'][0]['geometry']['location']['lng']
		return d
	except IndexError as e:
		# print("PAU", cep) #, result)
		global list_postal_codes
		list_postal_codes.append([cep, geo_args['address']])


def writeCSV(ceps, filename='geocode.txt'):
	f = open(filename, 'a')

	count = 0
	for i in ceps:
		# if count > 3:
		# 	break
		address = 'Brasil São Paulo {0} {1} {2}'.format(i['bairro'], i['log_tipo_logradouro'], i['logradouro'])
		d = geocode(i['cep'], address)
		f.write(str(d))
		f.write(',\n')
		f.flush()
		print(count)
		count+=1

	count = len(list_postal_codes)
	while list_postal_codes:
		p = list_postal_codes.pop()
		d = geocode(p[0],p[1])
		f.write(str(d))
		f.write(',\n')
		f.flush()
		print(count)
		count-=1

	f.closed

def writeCSV2(entrada1=[], entrada2=[], saida='geocodeSaida.csv'):

	# "log_tipo_logradouro", "logradouro", "bairro", "cidade", "uf", "cep"

	f = open(saida, 'a')
	for i in entrada1:
		if 'address' not in i:
			for j in entrada2:
				if i['postal_code'] == j['cep']:
					i['address'] = '{0} {1}'.format(j['log_tipo_logradouro'], j['logradouro'])
					i['neighborhood'] = j['bairro']
					f.write(str(i))
					f.write(',\n')
					f.flush()
		else:
			f.write(str(i))
			f.write(',\n')
			f.flush()
	f.closed



